import React from "react";
import "./App.css";
import Search from "./components/Search";
import { Route } from "react-router-dom";

const App = props => {
  console.log(props);
  return (
    <div className="App">
      <Route exact path="/" render={props => <Search {...props} />} />
    </div>
  );
};

export default App;
